import React from "react";
import FooterLink from "./FooteLink"

const FooterQuickLinks = () =>{

    return(
        <>
            <FooterLink 
                name={"About us"}
                href={"#"}
            />
            <FooterLink 
                name={"Contact us"}
                href={"#"}
            />
            <FooterLink 
                name={"Products"}
                href={"#"}
            />
            <FooterLink 
                name={"Login"}
                href={"#"}
            />
            <FooterLink 
                name={"Sign Up"}
                href={"#"}
            />
        </>
    )
}

export default FooterQuickLinks;
